import * as ReactBootstrap from 'react-bootstrap';
import './Navigation.css';
import {Link} from 'react-router-dom';


function Navigation() {
  return (
    <div class="hadow-lg p-3 mb-5 bg-body rounded" >
    <ReactBootstrap.Navbar fixed="top"  collapseOnSelect expand="lg" className="nav-bar-color box-shadow" variant="light">
      <ReactBootstrap.Container>
        <ReactBootstrap.Navbar.Brand class='brand' href="/">MAke YOur Event HAppen</ReactBootstrap.Navbar.Brand>

          <ReactBootstrap.Nav>
            <Link class='bookevent-btn'to="/Book Event">signin</Link>
          </ReactBootstrap.Nav>

      </ReactBootstrap.Container>
    </ReactBootstrap.Navbar>
    </div>


  )
}

export default Navigation;
